function Header(props) {
  return (
      <nav
          className="bg-white border-gray-200 px-2 sm:px-4 py-2.5 rounded dark:bg-gray-900">
        <div
            className="container flex flex-wrap items-center justify-center mx-auto">

            <span
                className="self-center text-xl font-semibold whitespace-nowrap dark:text-white">{props.headername}</span>

        </div>
      </nav>

  );
}

export default Header
